import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Welcome from './Welcome.js';
import SignUp from './SignUp.js';
import Items from './Items.js';
import Me from './Me.js';
import Cart from './Cart.js';
import Navbar from './Navbar.js';
import NotFound from './NotFound.js';
import React, { Redirect } from 'react';
import { IsAuthenticated } from './Api/Auth.js';
console.log(IsAuthenticated());

function App() {
  return (
    <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/'       element={<Welcome />}>         </Route>
        <Route path='signUp'  element={IsAuthenticated() ? (<SignUp />) : (<Welcome/>)}>          </Route>
        <PrivateRoute path='items'   element={<Items />}>    </PrivateRoute>
        <PrivateRoute path='me'      element={<Me />}>       </PrivateRoute>
        <PrivateRoute path='cart'    element={<Cart />}>     </PrivateRoute>
        <Route path='*'       element={<NotFound />}>        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
